Verenigde Staten
Komedie / Romantiek
96 minuten

goed

met Dane Cook, Jessica Alba en Dan Fogler

Chuck maakt het uit met zijn vriendin en al vrij snel hierna krijgt hij te horen dat ze de ware heeft gevonden en gaat trouwen. 
Met Chuck's nieuwe (ex)vriendin gebeurt hetzelfde. En zo herhaalt dit patroon zich. Het blijkt dat Chuck een soort 
geluksbrenger is voor alleenstaande jongedames. Ze willen allemaal met hem omgaan, om daarna de ware te vinden. Chuck echter 
moet een manier vinden om dit patroon te doorbreken en een vriendin voor zichzelf te houden.
